    false,nt"url": null,nt"notes": "This annual narrative report for Quivira
    National Wildlife Refuge outlines Refuge accomplishments during the 1976 calendar
    year. The report begins with an introduction to the Refuge and information about
    climatic and habitat conditions, and the system status. Construction, maintenance,
    and wildfires are also described. Habitat management is covered; croplands, grasslands,
    wetlands, and wilderness and special areas are discussed. The wildlife section of
    the report discusses endangered species, migratory birds, mammals, and non-migratory
    birds. Interpretation and recreation activities are outlined; topics include information
    and interpretation, recreation, and law enforcement. Field investigations, cooperative
    programs, items of interest, and safety information are discussed. N-R forms and
    photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
